export const USER_ACTIONS = {
  loadUsers: "users/loadUsers",
  startLoading: "users/startLoading",
  successLoading: "users/successLoading",
  failLoading: "users/failLoading",
};

export const loadUsers = () => ({
  type: USER_ACTIONS.loadUsers,
});
